function Header () {
    let items = ["Berlin", "Was", "Geht", "Ab"]

    return (
        <>  
            <div className="flex justify-center">
                <h1 className="text-2xl font-bold mb-4">List</h1>
                <ul className= "list-divide-y divide-gray-300">
                    {items.map((item) => (
                        <li key={item} className= "py-2 px-4 hover:bg-gray-100"> 
                        {item}
                        </li>
                    ))}
                </ul>
             </div>

        </>
    )
}

export default Header;
